typedef struct
{
    int inceput;
    int sfarsit;
    char nume[100];
}Activitate;

Activitate a[100];
Activitate aGasit[10];
int nrActivitati;

void afisareActivitati(int n, Activitate k[])
{
    int i;
    for(i=0;i<n;i++)
    {
        printf("%d %d %s\n", k[i].inceput, k[i].sfarsit, k[i].nume);
    }
}

void sortareActivitati()
{
    int i,j;
    for(i=0;i<nrActivitati-1;i++)
    {
        for(j=i+1;j<nrActivitati;j++)
        {
            if( a[i].sfarsit > a[j].sfarsit )
            {
                Activitate aux = a[i];
                a[i] = a[j];
                a[j] = aux;
            }
        }
    }
}

int main()
{
    FILE* f;
    f=fopen("activitati", "r");
    fscanf(f, "%d", &nrActivitati);
    int i;
    for(i=0;i<nrActivitati; i++)
    {
        fscanf(f, "%d %d %s", &a[i].inceput, &a[i].sfarsit, &a[i].nume);
    }
    sortareActivitati();
    afisareActivitati(nrActivitati, a);
    printf("\nActivitatile pe care le pot face in timp optim: \n");

    int indice = 0;
    aGasit[indice] = a[0];

    for(i=0;i<nrActivitati;i++)
    {
        if(aGasit[indice].sfarsit<=a[i].inceput)
        {
            indice++;
            aGasit[indice]=a[i];
        }
    }

    afisareActivitati(indice+1, aGasit);

    return 0;
}

