#include <stdio.h>
#include <stdlib.h>

void interclasare(int array[], int left, int mid, int right)
{
    int i, j, k;
    int n1 = mid - left + 1;
    int n2 = right - mid;

    int left_temp[n1], right_temp[n2];

    for (i = 0; i < n1; i++)
        left_temp[i] = array[left + i];  // Fix: Change left+1 to left+i
    for (j = 0; j < n2; j++)
        right_temp[j] = array[mid + 1 + j];

    i = 0;
    j = 0;
    k = left;

    while (i < n1 && j < n2)
    {
        if (left_temp[i] <= right_temp[j])
        {
            array[k] = left_temp[i];
            i++;
        }
        else
        {
            array[k] = right_temp[j];
            j++;
        }
        k++;
    }

    while (i < n1)
    {
        array[k] = left_temp[i];
        i++;
        k++;
    }

    while (j < n2)
    {
        array[k] = right_temp[j];
        j++;
        k++;
    }
}

void mergeSort(int array[], int left, int right)
{
    if (left < right)
    {
        int mid = left + (right - left) / 2;
        mergeSort(array, left, mid);
        mergeSort(array, mid + 1, right);

        interclasare(array, left, mid, right);
    }
}

int main()
{
    int array[] = {21, 43, 66, 54, 63, 12, 99, 454, 0 , -65, 1};
    int arrayLength = sizeof(array) / sizeof(array[0]);

    int i;
    printf("Sirul nesortat: \n");
    for (i = 0; i < arrayLength; i++)
        printf("%d ", array[i]);

    mergeSort(array, 0, arrayLength - 1);

    printf("\n\nSirul sortat: \n");
    for (i = 0; i < arrayLength; i++)
        printf("%d ", array[i]);

    return 0;
}

