int cautare_binarÄƒ_divide_et_impera(int sir[], int stanga, int dreapta, int element) {
    if (stanga <= dreapta) {
        int mijloc = stanga + (dreapta - stanga) / 2;

        if (sir[mijloc] == element) {
            return mijloc;  // Elementul a fost gÄƒsit
        } else if (sir[mijloc] < element) {
            return cautare_binarÄƒ_divide_et_impera(sir, mijloc + 1, dreapta, element);
        } else {
            return cautare_binarÄƒ_divide_et_impera(sir, stanga, mijloc - 1, element);
        }
    }

    return stanga;  // Elementul nu a fost gÄƒsit, se returneazÄƒ poziÈ›ia pentru inserare
}

int main() {
    int sir[] = {1, 2, 4, 5, 6, 8, 9};
    int lungime = sizeof(sir) / sizeof(sir[0]);
    int element_cautat;

    printf("Introduceti elementul pe care vreti sa il cautati: \n");

    scanf("%d", &element_cautat);

    int rezultat = cautare_binarÄƒ_divide_et_impera(sir, 0, lungime - 1, element_cautat);

    if (rezultat < lungime && sir[rezultat] == element_cautat) {
        printf("Elementul %d a fost gasit la pozitia %d.\n", element_cautat, rezultat);
    } else {
        printf("Elementul %d nu a fost gasit.\n", element_cautat);
    }
    return 0;
}

