Coada* initializare(Coada* q)
{
    q->size=0;
    q->head=0;
    q->tail=0;
    return q;
}

void enqueue(Coada* q, int s)
{
    if(q->size!=capacity)
    {
        q->vec[q->tail]=s;
        q->tail++;
        q->size++;
    }
    else
    {
        printf("overflow");
    }
}

int dequeue(Coada* q)
{
    int d;
    if(q->size!=0)
    {
        d=q->vec[q->head];
        q->size--;
        q->head++;
        return d;
    }
    else
    {
        printf("dfsadsa\n");
    }
}

