{
    Coada q;
    initializare(&q);
    enqueue(&q,s);
    int* vizitat=(int*)calloc(g.n,sizeof(int));
    vizitat[s]=1;
    while(q.size!=0)
    {
        int d=dequeue(&q);
        printf("%d ", d);
        for(int i=1;i<=g.n;i++)
        {
            if(g.matrice[d][i]==1)
            {
                if(!vizitat[i])
                {
                    vizitat[i]=1;
                    enqueue(&q,vizitat[i]);

                }
            }
        }
    }
}



