#include <stdio.h>
#include <stdlib.h>

#define M 10

typedef struct Noode
{
    int key;
    struct Node* next;
} NodeT;

void initTable(NodeT * hTable[M])
{
    int i;
    for(i=0; i<M; i++)
    {
        hTable[i]=NULL;
    }
}

void insertElement(NodeT* hTable[M], int key)
{
    int f = key % M;

    NodeT* p=(NodeT*)malloc(sizeof(NodeT));
    p->key = key;
    p->next = hTable[f];

    hTable[f]=p;
}

NodeT* findElement(NodeT* hTable[M], int key)
{
    int f = key % M;
    NodeT* currentNode= hTable[f];

    while(currentNode != NULL)
    {
        if(currentNode->key==key)
        {
            return currentNode;
        }
        currentNode=currentNode->next;
    }
    return nullptr;
}

void deleteElement(NodeT* hTable[M], int key)
{
    int f = key % M;
    NodeT* currentNode= hTable[f];
    NodeT* prev = NULL;

    while(currentNode != NULL)
    {
        if(currentNode->key==key)
        {
            if(prev==NULL)
            {
                hTable[f]=currentNode->next;
            }
            else
            {
                prev->next=currentNode->next;
            }
            free(currentNode);
            break;
        }
        prev=currentNode;
        currentNode=currentNode->next;
    }
}

void displayTable(NodeT* hTable[M])
{
    int i;
    for(i=0; i<M; i++)
    {
        NodeT* currentNode= hTable[i];
        printf("Tabela[%d]: ", i);
        while(currentNode != NULL)
        {
            printf("%d -> ", currentNode->key);
            currentNode = currentNode->next;
        }
        printf("NULL\n");
    }
    printf("\n");
}

