#include <stdio.h>
#include <stdlib.h>

#define CAPACITY 10

typedef struct queue{
    int size;
    int head, tail;
    int vec[CAPACITY];
}Queue;

void initialize(Queue *myQueue)
{
    myQueue->head = 0;
    myQueue->tail = 0;
    myQueue->size = 0;
}

void enqueue(Queue* myQueue, int givenKey)
{
    if( myQueue->size!=CAPACITY)
    {
        myQueue->vec[myQueue->tail]=givenKey;
        myQueue->size++;
        myQueue->tail++;

        if(myQueue->tail>CAPACITY)
        {
            myQueue->tail=0;
        }
    }
    else
    {
        printf("Overflow\n");
    }
}

int dequeue(Queue *myQueue)
{
    int d;
    if(myQueue->size!=0)
    {
        d=myQueue->vec[myQueue->head];
        myQueue->head++;
        myQueue->size--;
        return d;
    }
    else
    {
        printf("Queue is empty");
        return -1;
    }
}

void displayQueue(Queue myQueue)
{
    if(myQueue.size==0)
    {
        puts("Queue is empty");
    }
    else
    {
        int i=myQueue.head;
        for(int j=0;j<myQueue.size;j++)
        {
            printf("%d ", myQueue.vec[i]);
            i++;
            if(i==CAPACITY)
            {
                i=0;
            }
        }
    }
    printf("\n");
}

