#include <stdio.h>
#include <stdlib.h>

typedef struct NodeT{
    int key;
    struct NodeT* next;
}Node;

Node* createNode(int key)
{
    Node* newNode=(Node*)malloc(sizeof (Node));
    newNode->key=key;
    newNode->next=NULL;
    return newNode;
}

void pushStack(Node** stack, int givenKey)
{
    Node* newNode= createNode(givenKey);
    if(*stack==NULL)
    {
        *stack=newNode;
    }
    else
    {
        newNode->next=*stack;
        *stack=newNode;
    }
}

int popStack(Node** stack)
{
    Node* node;
    if(*stack!=NULL)
    {
        int d=(*stack)->key;
        node=*stack;
        *stack=(*stack)->next;
        free(node);
        return d;
    }
    else
    {
        printf("The stack is empty");
    }
    return -1;
}

void displayStack(Node* stack)
{
    Node* node=stack;
    while(node!=NULL)
    {
        printf("%d \n", node->key);
        node=node->next;
    }
}

int main() {
    Node* stack=NULL;
    pushStack(&stack,4);
    pushStack(&stack,3);
    pushStack(&stack,2);
    pushStack(&stack,1);

    int d=popStack(&stack);
    printf("%d ", d);
    printf("\n");
    displayStack(stack);
    return 0;
}

#include <stdio.h>
#include <stdlib.h>

typedef struct node
{
    int id;
    struct node *left;
    struct node *right;
}Node;

Node* createBinTreeFromFile(FILE* f)
{
    Node* p;
    int c;

    fscanf(f, "%d", &c);

    if(c==0)
    {
        return NULL;
    }
    else
    {
        p=(Node*)malloc(sizeof(Node));
        if(p==NULL)
        {
            printf("No memory in createBinTree");
        }
        p->id=c;
        p->left= createBinTreeFromFile(f);
        p->right= createBinTreeFromFile(f);
    }
    return p;
}

void preorder(Node* p)
{
    if(p!=NULL)
    {
        printf("%d ", p->id);
        preorder ( p->left);
        preorder (p->right);
    }
}

void inorder(Node* p)
{
    if(p!=NULL)
    {
        inorder(p->left);
        printf("%d ", p->id);
        inorder(p->right);
    }
}

void postorder(Node* p)
{
    if(p!=NULL)
    {
        postorder(p->left);
        postorder(p->right);
        printf("%d ", p->id);
    }
}

int leafNode(Node* p)
{
    if(p==NULL)
        return 0;
    else if(p->left == NULL && p->right == NULL)
        return 1;
    else
        return leafNode(p->left)+ leafNode(p->right);
}

int internNode(Node *p)
{
    if(p==NULL)
        return 0;
    else if(p->left != NULL || p->right!=NULL)
    {
        return 1 + internNode(p->left) + internNode(p->right);
    }
    else
        return 0;
}

void printInternNodes(Node *p)
{
    if(p==NULL){
        printf("The tree is empty");
    }
    else if(p->left != NULL || p->right!=NULL)
    {
        printf("%d ", p->id);
        printInternNodes(p->left);
        printInternNodes(p->right);
    }
    else
        printf("There are no internal nodes");
}

int getHeight(Node* root) {
    if (root == NULL) {
        // DacÄƒ arborele este gol, Ã®nÄƒlÈ›imea este -1
        return -1;
    } else {
        // CalculÄƒm Ã®nÄƒlÈ›imea recursiv, adÄƒugÃ¢nd 1 È™i alegÃ¢nd maximul dintre Ã®nÄƒlÈ›imile subarborilor stÃ¢ng È™i drept
        int leftHeight = getHeight(root->left);
        int rightHeight = getHeight(root->right);
        return 1 + (leftHeight > rightHeight ? leftHeight : rightHeight);
    }
}

