#include <stdio.h>
#include <stdlib.h>


typedef int KeyType;
typedef struct node
{
    KeyType key;
    struct node *left;
    struct node *right;
}NodeT;
NodeT* root;
NodeT* InsertNode(NodeT* root, int key)
{
    if(root == NULL)
    {
        root = (NodeT*)malloc(sizeof(NodeT));
        root->key = key;
        root->left = NULL;
        root->right = NULL;
        return root;
    }
    if(root->key == key)
        return root;
    if(root->key < key)
    {
        root->right = InsertNode(root->right, key);
    }
    else
        root->left = InsertNode(root->left,key);
    return root;
}
void Inorder(NodeT* root)
{
    if(root != NULL)
    {
        Inorder(root->left);
        printf("%d ",root->key);
        Inorder(root->right);
    }
}
NodeT* searchKey( NodeT* root,KeyType key )
{
    if(root == NULL || root->key == key)
        return root;
    if(root->key > key)
        return searchKey(root->left,key);
    else
        return searchKey(root->right,key);

}
NodeT* findMin(NodeT* root)
{
    if(root == NULL || root->left == NULL)
        return root;
    return findMin(root->left);
}
NodeT* findMax(NodeT* root)
{
