#include <stdio.h>
struct info
{
    int ID;
    char name[100];
    float cgpa;
};
int main()
{
    int N;
    scanf("%d", &N);
    struct info student[N];
    for(int i = 0; i < N; i++)
    {
        scanf("%d %s %f", &student[i].ID, &student[i].name, &student[i].cgpa);
    }
    struct info temp;
    for(int i = 0; i < N-1; i++)
    {
        for(int j = i+1; j < N; j++)
        {
            if(student[j].cgpa < student[i].cgpa){
                temp = student[i];
                student[i] = student[j];
                student[j] = temp;
            }
        }
    }
    for(int i = 0; i < N; i++)
    {
        printf("%d %s %.2f\n", student[i].ID, student[i].name, student[i].cgpa);
    }
    return 0;
}
