void checkPrime(int N) 
{ 
    int flag = 1; 
    for (int i=2;i<= N/2;i++) {
        if (N%i==0) {
            flag=0; 
            break; 
        } 
    } 
    if(flag) { 
        printf("%d is a Prime Number\n",N); 
    } 
    else{ 
        printf("%d is not a Prime Number\n", N); 
    } 
  
    return; 
} 
  
